import React from 'react'
import { Link } from 'react-router-dom'
import './Navbar.css'

function Navbar() {
    return (
        <nav className='bg-dark'>
            {/* Logo */}
            <Link to="/">
                <img className='navbar-logo' src="http://pngimg.com/uploads/amazon/amazon_PNG11.png" />
            </Link>

            {/* Search bar */}
            <input className='navbar-input' />

        </nav>
    )
}

export default Navbar
